// Entity count: 2408
// HTML structure: text_content

pub fn transform_batch(entities: Vec<RawEntity>) -> Result<Vec<ProcessedEntity>> {
    let mut processed = Vec::new();

    for entity in entities {
        // Transform to ORM entity
        let processed_entity = ProcessedEntity {
            uuid: entity.uuid,
            processed_content: transform_html_content(entity.html_content)?,
            // Add more fields based on semantic analysis
        };

        processed.push(processed_entity);
